import Contact from "./component/Contact";
import About from "./component/About";
import Footer from "./component/Footer";
import Home from "./component/Home";
import Navbar from "./component/Navbar";

import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Login_Student from "./component/Login_Student";
import Login_Organization from "./component/Login_Organization";
import Registration_Student from "./component/Registration_Student";
import Registration_Organization from "./component/Registration_Organization";
import ScrollToTop from "./component/ScrollToTop";


const App = () => {
  return (
    <>
      <Router>
        <Navbar />
        <ScrollToTop/>

        <Routes>


          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/StudentRegistration" element={<Registration_Student />} />
          <Route path="/StudentLogin" element={<Login_Student />} />
          <Route path="/OrganizationRegitration" element={<Registration_Organization />} />
          <Route path="/OrganizationLogin" element={<Login_Organization />} />

        </Routes>
        <Footer />

      </Router>
    </>
  );
};

export default App;
